### 思路

遍历字符串；
- 创建一个结果数组`res`，长度与字符串长度相同；并对每一个数组项赋初值`Infinity`;
- 如果当前字符的值于目标字符`c`相同，那当前的`res[i] = 0`,并以当前位置向两边发散：如果一个字符到当前字符的距离比他原有的值要小(`res[j] > i - j`)，那就对其进行重新赋值；反之则终止此次发散。
- 最终返回结果数组`res` 

### 代码


```js
/**
 * @param {string} s
 * @param {character} c
 * @return {number[]}
 */
var shortestToChar = function(s, c) {
    const len = s.length;
    let res = new Array(len).fill(Infinity);
    for(let i = 0; i < len; i++) {
        if(s[i] === c) {
            res[i] = 0;
            for(let j = i - 1; j >= 0; j--) {
                if(res[j] > i - j) {
                    res[j] = i - j;
                } else {
                    break;
                }
            }

            for(let j = i + 1; j < len; j++) {
                if(res[j] > j - i) {
                    res[j] = j - i;
                } else {
                    break;
                }
            }
        }
    }

    return res;
};

```

