# 思路
将k和num全都转化为num数组，倒叙排列后逐位相加，逐位相加后如果超过9了说明需要进位，将进位符置1，如不满则为0，将保留各位后的数字添加进结果数组。
依次相加后直到某个长度更短的数组全部遍历完后结束相加过程。
最后将数组倒序回来就可以得到最终的结果

# 代码
```
class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        List<Integer> res = new ArrayList<Integer>();
        int n = num.length;
        // 1. 从后往前逐位相加
        for(int i = n - 1; i >= 0; i--){
            // 逐位相加
            int sum = num[i] + k % 10;         
            k /= 10;    
            // 两位相加 进位
            if(sum >= 10){
                k++;                        // 进位到k的末尾
                sum -= 10;                  // 进位清掉
            }
            // 1.2 当前相加的结果 添加到结果集
            res.add(sum);
        }

        // 2. k的数字长度大于数组的数字长度
        for(; k > 0; k /= 10){               
            res.add(k % 10);               
        }

        // 3. 结果集翻转
        Collections.reverse(res);
        return res;
    }
}
